('14','1','2018-08-14 12:03:07','2018-08-14 12:03:07','[ux_slider label=\"ola\"]\n\n[ux_banner height=\"500px\" bg=\"23\" bg_overlay=\"rgba(0, 0, 0, 0.2)\" video_loop=\"false\" sticky=\"true\"]\n\n[text_box width=\"40\" width__sm=\"60\" padding=\"30px 30px 30px 30px\" position_x=\"5\" position_y=\"50\" bg=\"rgba(0, 0, 0, 0.86)\" depth=\"3\"]\n\n<h2 class=\"uppercase\"><strong>TaxiAGRA</strong></h2>\n<h3>Welcomes You!</h3>\n<p><span style=\"font-size: 200%;\">Call @ 12345-67890</span></p>\n<p class=\"lead\"><span style=\"font-size: 150%;\">Book Cab To Agra At AffordablePrices</span></p>\n[button text=\"Book Now!\" radius=\"99\"]\n\n\n[/text_box]\n\n[/ux_banner]\n\n[/ux_slider]\n[gap]\n\n[row]\n\n[col span__sm=\"12\" padding=\"0 0px 0px 0px\" margin=\"0 0px 0px 0px\"]\n\n[message_box bg=\"22\" bg_color=\"rgba(23, 21, 21, 0.77)\"]\n\n[row_inner v_align=\"middle\" h_align=\"center\"]\n\n[col_inner span=\"9\" span__sm=\"12\"]\n\n<h3>About Us</h3>\n<p>Travelling by<strong>cab in Agra</strong>is a safe and secure way. With a wide network and convenient way of hiring cabs in Agra we provide quick and fast service. For years Agra is quite famous as a travel destination in India. It is not only famous for Taj Mahal but it also have other places which are a masterpiece of architectural beauty as well. Agra being near from Delhi ,the best way to explore all the architectural buildings of the city is to travel by a cab.</p>\n<p>There are many companies which provide<strong>car rentals in Agra</strong>. But we are different as we always tries to give our best possible facility for our clients. Our main speciality is our commitment with our clients. We keep our words from starting till the end and thus no problem is faced by any one. The respect we have for our clients makes us different from others. We provide all sort of cars for rent like luxury, economical and family. Our experts are always working to provide best possible service for our clients .Our team works in providing the quality work for our clients. Hiring a taxi service in Agra is easy and convenient by all means by our company.</p>\n<p>Our taxi are all updated and well maintained for your convenient travelling experience which will make your trip worth remembering as well our services.We keep our drivers well informed about all the places and routes and they all are well trained and mannered.It is quite easy for<strong>car hire in Agra</strong>with our online facilities. The pain and inconvenience caused by searching cabs and public transport is really a hell-like experience. We provide car hire in Agra in the easiest way possible.</p>\n\n[/col_inner]\n[col_inner span=\"2\" span__sm=\"12\" align=\"center\"]\n\n[button text=\"Book Now\" color=\"white\" style=\"outline\" radius=\"99\"]\n\n\n[/col_inner]\n\n[/row_inner]\n\n[/message_box]\n\n[/col]\n\n[/row]\n[scroll_to title=\"tariff\" bullet=\"false\"]\n\n[row]\n\n[col span__sm=\"12\"]\n\n<div class=\"table-responsive\">\n<h2 style=\"text-align: center;\">Our Tariffs</h2>\n<table class=\"gen-table\">\n<caption>Local Sight Seeing</caption>\n<tbody>\n<tr>\n<th width=\"260px\">SIGHTS</th>\n<th colspan=\"2\" align=\"center\">TEMPOO TRAVELLER</th>\n<th colspan=\"2\" align=\"center\">TATA INDIGO</th>\n<th colspan=\"2\" align=\"center\">MARUTI SWIFT DZIRE</th>\n<th colspan=\"2\" align=\"center\">TAVERA</th>\n<th colspan=\"2\" align=\"center\">INNOVA</th>\n</tr>\n<tr>\n<td></td>\n<td align=\"center\">(Non A/C)</td>\n<td align=\"center\">(A/C)</td>\n<td align=\"center\">Car (Non A/C)</td>\n<td align=\"center\">Car (A/C)</td>\n<td align=\"center\">Car (Non A/C)</td>\n<td align=\"center\">Car (A/C)</td>\n<td align=\"center\">Car (Non A/C)</td>\n<td align=\"center\">Car (A/C)</td>\n<td>Non A/C-A/C</td>\n</tr>\n<tr>\n<td>Visit to Tajmahal and Agra fort (Half day-4 Hours)</td>\n<td>Rs 2600</td>\n<td>Rs 2900</td>\n<td>Rs 1000</td>\n<td>Rs 1200</td>\n<td>Rs 1100</td>\n<td>Rs 1300</td>\n<td>Rs 1400</td>\n<td>Rs 1500</td>\n<td>Rs 2100</td>\n</tr>